import { useEffect, useRef } from "react";

import "./App.css";

let entities = [1, 2, 3, 4];

let set = [];

let index = 1

for (let i = 0; i < entities.length; i++) {
  for (let j = i + 1; j < entities.length; j++) {
    set = [...set, [entities[i], entities[j]]];
  }
}
function next(id: boolean, left, right) {
  if(index < set.length){
    left.current.innerText = set[index][0];
    right.current.innerText = set[index][1];
    index++;
  }else{
    alert("End of list")
  }
}
function App() {
  const left = useRef(null)
  const right = useRef(null)
  useEffect(() => {
    left.current.innerText = set[0][0];
    right.current.innerText = set[0][1];
  }, []);
  return (
    <>
      <div
        className="box left"
        onClick={() => {
          next(false, left, right);
        }}
        ref={left}
      ></div>
      <div
        className="box right"
        onClick={() => {
          next(true, left, right);
        }}
        ref={right}
      ></div>
    </>
  );
}

export default App;
